import React from 'react';
import Divider from "@material-ui/core/Divider";
import {makeStyles} from "@material-ui/core/styles";
import Box from "@material-ui/core/Box";

import Header from "../_layouts/_includes/header/Header";
import Content from "../_layouts/_includes/content/Content";
import Footer from "../_layouts/_includes/footer/Footer";

import RSteamProfile from '../../../assets/img/aw_steam_profile.png'
import RAeWorkflow from '../../../assets/img/aw_ae_workflow.png'
import Typography from "@material-ui/core/Typography";

const images = [
    {
        url: RSteamProfile,
        title: 'Burgers',
        width: '30%',
    },
    {
        url: RAeWorkflow,
        title: 'Camera',
        width: '30%',
    },
];


const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
    },
    wrapper: {
        display: 'flex',
        height: '100vh',
        flexDirection: 'column',
        flexGrow: 1,
    },
    content: {
        flexGrow: 1,
        padding: theme.spacing(3),
    },
}));

export default function Home(props) {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Header/>

            <div className={classes.wrapper}>
                <Content>
                    <Typography align="center" variant="h4" gutterBottom>
                        Предложи свою идею для создания композиции или зацени уже имеющиеся!
                    </Typography>
                    <Divider variant="middle"/>
                    <div>
                        
                    </div>
                </Content>
                <Footer/>
            </div>
        </div>
    );
}
